import { playCloseSound } from '../util/sounds'
import { backMode } from '../states/appMode'
import { center } from '../styles/styles'

export const BackButton = () => (
  <button
    style={center}
    onClick={() => {
      playCloseSound()
      backMode()
    }}
  >
    Back
  </button>
)
